fn count_newlines(v : &[u32]) -> i32{
let mut count=0;
let mut i=0;
let mut is_inside_quotes=false;
for k in 0..v.len(){
let c = v[k];
if c==64{
for j in 0..v.len(){
if v[j]>100{
i+=3;
} else if v[j]>10{
i+=2;
} else{
i+=1;
}
if i>=COL_LEN{
i=0;
count+=1;
}
if j<v.len()-1{
i+=1;
if i>=COL_LEN{
i=0;
count+=1;
}
}
}
i+=1;
if i>=COL_LEN{
count+=1;
i=0;
}
i+=1;
if i>=COL_LEN{
count+=1;
i=0;
}
}
else{
i+=1;
if(c==32||c==40||c==41||c==59||c==123||c==125) && i>=COL_LEN{
if !is_inside_quotes{
i=0;
count+=1;
}
}
else if c==34{
is_inside_quotes=!is_inside_quotes;
}
}
}
return count;
}


fn print_array(i : &mut i32, current_row : &mut i32, v : &[u32]) {
print!("[");
for j in 0..v.len(){
print!("{}",v[j]);
if v[j]>100{
*i+=3;
} else if v[j]>10{
*i+=2;
} else{
*i+=1;
}
if *i>=COL_LEN{
println!();
*i=0;
*current_row+=1;
}
if j<v.len()-1{
print!(",");
*i+=1;
if *i>=COL_LEN{
println!();
*i=0;
*current_row+=1;
}
}
}
print!("]");
*i+=1;
if *i>=COL_LEN{
println!();
*i=0;
*current_row+=1;
}
print!(";");
*i+=1;
if *i>=COL_LEN{
println!();
*i=0;
*current_row+=1;
}
}


